pto_cobos and more to bring you the best possible project !  Here you can see a small glimpse of countless hours of work that this project is ! Now the art is not the only crazy idea behind this project , go and check out the road map for it ! We are really trying here to bring the best product we can and I hope you see and can appreciate the hard work that went into it ! Join the @thesamuraisaga discord to find out more about the project! :) #nft"}}]},"edge_media_to_comment":{"count":44},"comments_disabled":false,"taken_at_timestamp":1639063075,"edge_liked_by":{"count":3800},"edge_media_preview_like":{"count":3800},"location":null,"thumbnail_src":"https://instagram.fatl1-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.113.1440.1440a/s640x640/265562137_464640288428517_5496688886139532997_n.jpg?_nc_ht=instagram.fatl1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=EcVDRZFY8S4AX_Q_Xhg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=00_AT_tvDrNd3FzQ7v64KiQOgw-GtEom9qfUBfsMAGj-mJnSQ\u0026oe=61DC6B50\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fatl1-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.113.1440.1440a/s150x150/265562137_464640288428517_5496688886139532997_n.jpg?_nc_ht=instagram.fatl1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=EcVDRZFY8S4AX_Q_Xhg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=00_AT_76SYbR7JAB8zQO6CJwR-GE4vFqUojMAIW_plB4k_YOA\u0026oe=61DD7540\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fatl1-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.113.1440.1440a/s240x240/265562137_464640288428517_5496688886139532997_n.jpg?_nc_ht=instagram.fatl1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=EcVDRZFY8S4AX_Q_Xhg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=00_AT9kodaBJ3fcWzDcd8ewMRsdJ5yYL3RfcO9ItRIy9gXxhQ\u0026oe=61DD453A\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.fatl1-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.113.1440.1440a/s320x320/265562137_464640288428517_5496688886139532997_n.jpg?_
